import '../css/footer.css'

const Footer = () => {
    return (
        <footer>  
            <div className="footer"> 
                
                <p>(우) 11921 경기도 구리시 건원대로 44태영빌딩 4층</p>
                <p>대표자 : 정진용</p>
                <p>운영진 : 이진선 | 박수연 | 김해인 | 정슬기</p>
                <p>Copyright(C) 2025. ID뭐? All Rights Reserved.</p>
                </div>
        </footer>
    )
}
export default Footer;
